public void fWD_gerar_DEFNUM()
{
// procedure Gerar_DEFNUM()
initExecProcLocale("Gerar_DEFNUM");



try
{

////////////////////////////////////////////////////////////////////////////
// Déclaration des variables locales au traitement
// (En WLangage les variables sont encore visibles après la fin du bloc dans lequel elles sont déclarées)
////////////////////////////////////////////////////////////////////////////
WDObjet vWD_oRequest = WDVarNonAllouee.ref;
WDObjet vWD_oResponse = WDVarNonAllouee.ref;



try
{
// oRequest	is restRequest
vWD_oRequest = new WDInstance( new WDHTTPRequete() );


// oResponse	is restResponse
vWD_oResponse = new WDInstance( new WDHTTPReponse() );


// oRequest..URL		= gsPathRest+"defnum"
vWD_oRequest.setProp(EWDPropriete.PROP_URL,GWDPIlumination_Park.getInstance().vWD_gsPathRest.opPlus(WDContexte.compact("DE758F815CC4CA852DF6051D552B6A51F1C8F04E376CC44406EBB6F641CFC029")));

// oRequest..Method	= httpGet
vWD_oRequest.setProp(EWDPropriete.PROP_METHODE,1);

// oResponse			= RESTSend(oRequest)
vWD_oResponse.setValeur(WDAPIHttp.HTTPEnvoie(vWD_oRequest));

// IF ErrorOccurred THEN
if(WDObjet.ErreurDetectee.getBoolean())
{
}
else
{
// 	IF oResponse..StatusCode = 200 THEN
if(vWD_oResponse.getProp(EWDPropriete.PROP_CODEETAT).opEgal(200, 0))
{
// 		sRetJSON	is Buffer	= oResponse..Content					
WDObjet vWD_sRetJSON = new WDBuffer();


vWD_sRetJSON.setValeur(vWD_oResponse.getProp(EWDPropriete.PROP_CONTENU));


// 		sRest		is EstruturaRegistro
WDObjet vWD_sRest = WDVarNonAllouee.ref;
vWD_sRest = new GWDCEstruturaRegistro();


// 		Deserialize(sRest, sRetJSON, psdJSON)
WDAPISerialise.deserialise(vWD_sRest,vWD_sRetJSON,1024);

// 		n is int = sRest.qtd				
WDObjet vWD_n = new WDEntier4();


vWD_n.setValeur(vWD_sRest.checkType(GWDCEstruturaRegistro.class).mWD_qtd);


// 		FOR i = 1 TO n
// 		FOR i = 1 TO n
for(WDObjet vWD_i = new WDEntier4(1);vWD_i.opInfEgal(vWD_n);vWD_i.opInc())
{
// 			nDEFNUM = sRest.registros[i].id
vWD_nDEFNUM.setValeur(vWD_sRest.checkType(GWDCEstruturaRegistro.class).mWD_registros.get(vWD_i).checkType(GWDCstRegistro.class).mWD_id);

}

}

}

}
catch(WDErreurNonFatale | WDException eCatch)
{
eCatch.catch_GEN();
return;
}
}
finally
{
finExecProcLocale();

}
}



